import React, { Component } from 'react';
import ReactPlayer from "react-player";

export class Home extends Component {




    render() {
        return (
            <div>
            <header className="App-header">
            <ReactPlayer
                    controls={true}
                    src={this.state.video.src}
                    // poster={this.state.video.poster}
                    width="720"
                    height="420"
             />
            </header>
                <h1>Home</h1>
            </div>
        )
    }
}

export default Home
